  \"2016-07-15T19:13:04.416128\",\n\t\"name\": \"color-feret-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The DOD Counterdrug Technology Program
  sponsored the Facial Recognition Technology (FERET) program and development of the
  FERET database. The National Institute of Standards and Technology (NIST) is serving
  as Technical Agent for distribution of the FERET database. The goal of the FERET
  program is to develop new techniques, technology, and algorithms for the automatic
  recognition of human faces. As part of the FERET program, a database of facial imagery
  was collected between December 1993 and August 1996. The database is used to develop,
  test, and evaluate face recognition algorithms.\",\n\t\"license_title\": \"License
